sed;type:Phrase}}</div>\n<div>{{*home|closed;type:Phrase}}<em></em></div>\n<div>{{*logo|closed;type:Image}}</div>\n</blockquote>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<h1>Sets / Settings / Rules</h1>\n<div>&nbsp;</div>\n<div>You can create \"rules\" by applying&nbsp;<em>[[settings]]</em>&nbsp;(configurations) to&nbsp;<em>[[sets]]&nbsp;</em>(groups) of cards.</div>\n<blockquote>\n<div>{{setting|closed}}</div>\n<div>{{set|closed}}</div>\n</blockquote>\n<p>&nbsp;</p>\n<div>All the rules impacting a given card can be accessed through its \"Options\" tab. &nbsp;The [[*all]] set is for site-wide defaults:</div>\n<blockquote>\n<div>{{*all|open}}</div>\n</blockquote>\n<div>&nbsp;</div>\n<h1>Email / Account Configuration</h1>\n<div>&nbsp;</div>\n<div>Configure account-related emails here:</div>\n<blockquote>\n<div>{{*request|closed}}</div>\n<div>{{*signup|closed}}</div>\n{{*invite|closed}}</blockquote>\n<div>By default, system emails come from [[/card/options/Wagn_Bot| Wagn Bot\'s email address]] (set via the Options tab).</div>\n<blockquote>\n<div>{{Wagn Bot|closed}}</div>\n</blockquote>\n<div>You can [[http://www.wagn.org/wagn/custom_sign-up_information|further configure signups]] by&nbsp;[[http://www.wagn.org/wagn/formatting|formatting]]&nbsp;[[Account Request]] and [[User]] cards.</div>\n<div>&nbsp;</div>\n<div><em>[[http://www.wagn.org/wagn/account#Administering%20accounts | Learn  more about configuring accounts.]]</em></div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<h1>Miscellaneous options<br></h1>\n<div>&nbsp;</div>\n<blockquote>{{*css|closed;type:HTML}}\n<div>{{*sidebar|closed}}</div>\n<div>{{*tinyMCE|closed}}&nbsp;</div>\n<div>&nbsp;</div>\n<div>{{*google analytics key|closed; type:Phrase}} <em>[[http://wagn.org/wagn/Google_Analytics|How to set up Google  Analytics]]</em></div>\n<div>&nbsp;</div>\n<div>{{*favicon|closed;type:Image}} <em>[[http://www.wagn.org/wagn/favicon|How to customize your favicon]]</em></div>\n</blockquote>',3),(5945,'2012-12-05 11:16:24',298,1