033,'2012-12-05 11:16:24',466,1,'{\"match\":\"$keyword\", \"sort\":\"relevance\"}',3),(6036,'2012-12-05 11:16:24',357,1,'<p>Determines initial type and content of new cards in the [[set]]. [[http://www.wagn.org/wagn/formatting|More about formatting]].</p>',3),(6037,'2012-12-05 11:16:24',304,1,'<p>Anti-spam setting.  Requires non-signed-in users to complete a [[http://www.wagn.org/wagn/captcha|captcha]] before adding or editing cards in the [[set]].</p>',3),(6038,'2012-12-05 11:16:24',281,1,'<p>Default layout for any card in the [[set]].  [[http://wagn.org/custom_layouts | Learn more about layouts]]</p>',3),(6039,'2012-12-05 11:16:24',249,1,'<p>Autogenerate name for new cards in the [[set]] by incrementing this value. [[http://wagn.org/wagn/Autonaming|Learn more.]]</p>',3),(6040,'2012-12-05 11:16:24',254,1,'<p>Labels for [[Pointer]] radio button and checkbox items.  E.g., value <em>description</em> will use as labels <em>option 1+description</em>, <em>option 2+description</em>, etc. [[http://www.wagn.org/wagn/Pointer|Learn more.]]</p>',3),(6044,'2012-12-05 11:16:24',578,1,'',4),(6052,'2012-12-05 11:16:24',586,1,'1',NULL),(6053,'2012-12-05 11:16:24',587,1,'',NULL),(6054,'2012-12-05 11:16:24',588,1,'[[Anyone Signed In]]',NULL),(6055,'2012-12-05 11:16:24',589,1,'[[Administrator]]',NULL),(6063,'2012-12-05 11:16:24',151,1,'<p>[[Config|Configuration]]</p>\r\n<p> </p>\r\n<p>[[*account|Accounts]]</p>\r\n<p> </p>\r\n<p>[[/admin/clear_cache|Clear the cache]]</p>',NULL),(6072,'2012-12-05 11:16:24',56,1,'<p>People can <strong>invite new users via email</strong> if they have [[*account+*right|permission to create +*account]] cards.</p>\r\n<p> </p>\r\n<p>Newy invited users will be sent an email with a password and the following details:</p>\r\n<p> </p>\r\n<h2>Email subject</h2>\r\n<blockquote>\r\n<p>{{+*subject|type:Phrase}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<h2>Email message</h2>\r\n<blockquote>\r\n<p>{{+*message|type:PlainText}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<h2>Email from</h2>\r\n<blockquote>\r\n<p>{{+*from|type:Phrase}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<p><strong>After sending an invitation, you\'re taken here:</strong><span></span></p>\r\n<blockquote>\r\n<div>HTTP:// <em>(YOUR WAGN\'S DOMAIN) </em>{{+*thanks}}</div>\r\n</blockquote>',NULL),(6078,'2012-12-05 11:16:24',147,1,'<p>Administrators can create, read, update and delete any card in the system regardless of its permissions rules. [[http://wagn.org/wagn/permissions|Learn more]].</p>',NULL),(6081,'2012-12-05 11:16:24',225,1,'<p>Each [[user]] can be given roles to organize site permissions. [[http://wagn.org/wagn/Role|Learn more about roles]].</p>',NULL),(6086,'2012-12-05 11:16:24',66,1,'<p>People can <strong>sign up with no approval process</strong> if you allow \"Anyone\" to create both [[/card/option/Account_Request|account requests]] and  [[*account+*right| +*account cards]].</p>\r\n<p> </p>\r\n<p>Newly registered users will be sent an email with a password and the following details:</p>\r\n<p> </p>\r\n<h2>Email Subject</h2>\r\n<blockquote>\r\n<p>{{*signup+*subject|type:Phrase}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<h2>Email Message</h2>\r\n<blockquote>\r\n<p>{{*signup+*message|closed;type:PlainText}}</p>\r\n</blockquote>\r\n<p> </p>\r\n<p>As the email is sent, the<strong> person signing up will be sent here</strong>:</p>\r\n<blockquote>\r\n<div>HTTP://<em>(YOUR WAGN\'S DOMAIN)</em>{{+*thanks}}</div>\r\n</blockquote>\r\n<p> </p>\r\n<p> </p>',NULL),(6089,'2012-12-05 11:16:24',308,1,'<p>When \"yes\", users permitted to create [[*account+*right|+*account cards]] can add [[http://www.wagn.org/wagn/account|accounts]] to cards in the [[set]].</p>',NULL),(6257,'2012-12-05 11:16:24',276,1,'1',NULL),(6260,'2012-12-05 11:16:24',314,1,'<!DOCTYPE HTML>\r\n<html>\r\n  <head>\r\n    {{*head}}\r\n  </head>\r\n  \r\n  <body id=\"wagn\">\r\n    <div id=\"menu\">\r\n      [[/ | Home]]   [[/recent | Recent]]   {{*navbox}} {{*account links}}\r\n    </div>\r\n    \r\n    <div id=\"primary\"